 configs.4:\'kafka2.DescribeConfigsResourceResult32a  name:message.downconversion.enable  value:true  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.message.downconversion.enable  value:true  source:5"  config_type:1  documentation:"This configuration controls whether down-conversion of message formats is enabled to satisfy consume requests. When set to <code>false</code>, broker will not perform down-conversion for consumers expecting an older message format. The broker responds with <code>UNSUPPORTED_VERSION</code> error for consume requests from such older clients. This configurationdoes not apply to any message format conversion that might be required for replication to followers."\'  configs.5:\'kafka2.DescribeConfigsResourceResult32a  name:min.insync.replicas  value:1  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:min.insync.replicas  value:1  source:5"  config_type:3  documentation:\\\'When a producer sets acks to "all" (or "-1"), this configuration specifies the minimum number of replicas that must acknowledge a write for the write to be considered successful. If this minimum cannot be met, then the producer will raise an exception (either NotEnoughReplicas or NotEnoughReplicasAfterAppend).<br>When used together, <code>min.insync.replicas</code> and <code>acks</code> allow you to enforce greater durability guarantees. A typical scenario would be to create a topic with a replication factor of 3, set <code>min.insync.replicas</code> to 2, and produce with <code>acks</code> of "all". This will ensure that the producer raises an exception if a majority of replicas do not receive a write.\\\'\'  configs.6:\'kafka2.DescribeConfigsResourceResult32a  name:segment.jitter.ms  value:0  read_only:N  config_source:5  is_sensitive:N  config_type:5  documentation:"The maximum random jitter subtracted from the scheduled segment roll time to avoid thundering herds of segment rolling"\'  configs.7:\'kafka2.DescribeConfigsResourceResult32a  name:remote.log.copy.disable  value:false  read_only:N  config_source:5  is_sensitive:N  config_type:1  documentation:"Determines whether tiered data for a topic should become read only, and no more data uploading on a topic. Once this config is set to true, the local retention configuration (i.e. local.retention.ms/bytes) becomes irrelevant, and all data expiration follows the topic-wide retention configuration(i.e. retention.ms/bytes)."\'  configs.8:\'kafka2.DescribeConfigsResourceResult32a  name:local.retention.ms  value:-2  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.local.retention.ms  value:-2  source:5"  config_type:5  documentation:"The number of milliseconds to keep the local log segment before it gets deleted. Default value is -2, it represents `retention.ms` value is to be used. The effective value should always be less than or equal to `retention.ms` value."\'  configs.9:\'kafka2.DescribeConfigsResourceResult32a  name:cleanup.policy  value:delete  read_only:N  config_source:1  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:cleanup.policy  value:delete  source:1"  synonyms.1:"kafka2.DescribeConfigsSynonym32a  name:log.cleanup.policy  value:delete  source:5"  config_type:7  documentation:\\\'This config designates the retention policy to use on log segments. The "delete" policy (which is the default) will discard old segments when their retention time or size limit has been reached. The "compact" policy will enable <a href="#compaction">log compaction</a>, which retains the latest value for each key. It is also possible to specify both policies in a comma-separated list (e.g. "delete,compact"). In this case, old segments will be discarded per the retention time and size configuration, while retained segments will be compacted.\\\'\'  configs.10:\'kafka2.DescribeConfigsResourceResult32a  name:flush.ms  value:9223372036854775807  read_only:N  config_source:5  is_sensitive:N  config_type:5  documentation:"This setting allows specifying a time interval at which we will force an fsync of data written to the log. For example if this was set to 1000 we would fsync after 1000 ms had passed. In general we recommend you not set this and use replication for durability and allow the operating system\\\'s background flush capabilities as it is more efficient."\'  configs.11:\'kafka2.DescribeConfigsResourceResult32a  name:follower.replication.throttled.replicas  value:""  read_only:N  config_source:5  is_sensitive:N  config_type:7  documentation:"A list of replicas for which log replication should be throttled on the follower side. The list should describe a set of replicas in the form [PartitionId]:[BrokerId],[PartitionId]:[BrokerId]:... or alternatively the wildcard \\\'*\\\' can be used to throttle all replicas for this topic."\'  configs.12:\'kafka2.DescribeConfigsResourceResult32a  name:compression.lz4.level  value:9  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:compression.lz4.level  value:9  source:5"  config_type:3  documentation:"The compression level to use if compression.type is set to <code>lz4</code>."\'  configs.13:\'kafka2.DescribeConfigsResourceResult32a  name:segment.bytes  value:1073741824  read_only:N  config_source:4  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.segment.bytes  value:1073741824  source:4"  synonyms.1:"kafka2.DescribeConfigsSynonym32a  name:log.segment.bytes  value:1073741824  source:5"  config_type:3  documentation:"This configuration controls the segment file size for the log. Retention and cleaning is always done a file at a time so a larger segment size means fewer files but less granular control over retention."\'  configs.14:\'kafka2.DescribeConfigsResourceResult32a  name:retention.ms  value:604800000  read_only:N  config_source:5  is_sensitive:N  config_type:5  documentation:\\\'This configuration controls the maximum time we will retain a log before we will discard old log segments to free up space if we are using the "delete" retention policy. This represents an SLA on how soon consumers must read their data. If set to -1, no time limit is applied. Additionally, retention.ms configuration operates independently of "segment.ms" and "segment.bytes" configurations. Moreover, it triggers the rolling of new segment if the retention.ms condition is satisfied.\\\'\'  configs.15:\'kafka2.DescribeConfigsResourceResult32a  name:compression.gzip.level  value:-1  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:compression.gzip.level  value:-1  source:5"  config_type:3  documentation:"The compression level to use if compression.type is set to <code>gzip</code>."\'  configs.16:\'kafka2.DescribeConfigsResourceResult32a  name:flush.messages  value:9223372036854775807  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.flush.interval.messages  value:9223372036854775807  source:5"  config_type:5  documentation:\\\'This setting allows specifying an interval at which we will force an fsync of data written to the log. For example if this was set to 1 we would fsync after every message; if it were 5 we would fsync after every five messages. In general we recommend you not set this and use replication for durability and allow the operating system\\\\\\\'s background flush capabilities as it is more efficient. This setting can be overridden on a per-topic basis (see <a href="#topicconfigs">the per-topic configuration section</a>).\\\'\'  configs.17:\'kafka2.DescribeConfigsResourceResult32a  name:compression.zstd.level  value:3  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:compression.zstd.level  value:3  source:5"  config_type:3  documentation:"The compression level to use if compression.type is set to <code>zstd</code>."\'  configs.18:\'kafka2.DescribeConfigsResourceResult32a  name:message.format.version  value:3.0-IV1  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.message.format.version  value:3.0-IV1  source:5"  config_type:2  documentation:"[DEPRECATED] Specify the message format version the broker will use to append messages to the logs. The value of this config is always assumed to be `3.0` if `inter.broker.protocol.version` is 3.0 or higher (the actual config value is ignored). Otherwise, the value should be a valid ApiVersion. Some examples are: 0.10.0, 1.1, 2.8, 3.0. By setting a particular message format version, the user is certifying that all the existing messages on disk are smaller or equal than the specified version. Setting this value incorrectly will cause consumers with older versions to break as they will receive messages with a format that they don\\\'t understand."\'  configs.19:\'kafka2.DescribeConfigsResourceResult32a  name:max.compaction.lag.ms  value:9223372036854775807  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.cleaner.max.compaction.lag.ms  value:9223372036854775807  source:5"  config_type:5  documentation:"The maximum time a message will remain ineligible for compaction in the log. Only applicable for logs that are being compacted."\'  configs.20:\'kafka2.DescribeConfigsResourceResult32a  name:file.delete.delay.ms  value:60000  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.segment.delete.delay.ms  value:60000  source:5"  config_type:5  documentation:"The time to wait before deleting a file from the filesystem"\'  configs.21:\'kafka2.DescribeConfigsResourceResult32a  name:max.message.bytes  value:10485760  read_only:N  config_source:4  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:message.max.bytes  value:10485760  source:4"  synonyms.1:"kafka2.DescribeConfigsSynonym32a  name:message.max.bytes  value:1048588  source:5"  config_type:3  documentation:"The largest record batch size allowed by Kafka (after compression if compression is enabled). If this is increased and there are consumers older than 0.10.2, the consumers\\\' fetch size must also be increased so that they can fetch record batches this large. In the latest message format version, records are always grouped into batches for efficiency. In previous message format versions, uncompressed records are not grouped into batches and this limit only applies to a single record in that case."\'  configs.22:\'kafka2.DescribeConfigsResourceResult32a  name:min.compaction.lag.ms  value:0  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.cleaner.min.compaction.lag.ms  value:0  source:5"  config_type:5  documentation:"The minimum time a message will remain uncompacted in the log. Only applicable for logs that are being compacted."\'  configs.23:\'kafka2.DescribeConfigsResourceResult32a  name:message.timestamp.type  value:CreateTime  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.message.timestamp.type  value:CreateTime  source:5"  config_type:2  documentation:"Define whether the timestamp in the message is message create time or log append time. The value should be either `CreateTime` or `LogAppendTime`"\'  configs.24:\'kafka2.DescribeConfigsResourceResult32a  name:local.retention.bytes  value:-2  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.local.retention.bytes  value:-2  source:5"  config_type:5  documentation:"The maximum size of local log segments that can grow for a partition before it deletes the old segments. Default value is -2, it represents `retention.bytes` value to be used. The effective value should always be less than or equal to `retention.bytes` value."\'  configs.25:\'kafka2.DescribeConfigsResourceResult32a  name:preallocate  value:false  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.preallocate  value:false  source:5"  config_type:1  documentation:"True if we should preallocate the file on disk when creating a new log segment."\'  configs.26:\'kafka2.DescribeConfigsResourceResult32a  name:min.cleanable.dirty.ratio  value:0.5  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.cleaner.min.cleanable.ratio  value:0.5  source:5"  config_type:6  documentation:\\\'This configuration controls how frequently the log compactor will attempt to clean the log (assuming <a href="#compaction">log compaction</a> is enabled). By default we will avoid cleaning a log where more than 50% of the log has been compacted. This ratio bounds the maximum space wasted in the log by duplicates (at 50% at most 50% of the log could be duplicates). A higher ratio will mean fewer, more efficient cleanings but will mean more wasted space in the log. If the max.compaction.lag.ms or the min.compaction.lag.ms configurations are also specified, then the log compactor considers the log to be eligible for compaction as soon as either: (i) the dirty ratio threshold has been met and the log has had dirty (uncompacted) records for at least the min.compaction.lag.ms duration, or (ii) if the log has had dirty (uncompacted) records for at most the max.compaction.lag.ms period.\\\'\'  configs.27:\'kafka2.DescribeConfigsResourceResult32a  name:index.interval.bytes  value:4096  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.index.interval.bytes  value:4096  source:5"  config_type:3  documentation:"This setting controls how frequently Kafka adds an index entry to its offset index. The default setting ensures that we index a message roughly every 4096 bytes. More indexing allows reads to jump closer to the exact position in the log but makes the index larger. You probably don\\\'t need to change this."\'  configs.28:\'kafka2.DescribeConfigsResourceResult32a  name:unclean.leader.election.enable  value:false  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:unclean.leader.election.enable  value:false  source:5"  config_type:1  documentation:"Indicates whether to enable replicas not in the ISR set to be elected as leader as a last resort, even though doing so may result in data loss.<p>Note: In KRaft mode, when enabling this config dynamically, it needs to wait for the unclean leader electionthread to trigger election periodically (default is 5 minutes). Please run `kafka-leader-election.sh` with `unclean` option to trigger the unclean leader election immediately if needed.</p>"\'  configs.29:\'kafka2.DescribeConfigsResourceResult32a  name:retention.bytes  value:-1  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.retention.bytes  value:-1  source:5"  config_type:5  documentation:\\\'This configuration controls the maximum size a partition (which consists of log segments) can grow to before we will discard old log segments to free up space if we are using the "delete" retention policy. By default there is no size limit only a time limit. Since this limit is enforced at the partition level, multiply it by the number of partitions to compute the topic retention in bytes. Additionally, retention.bytes configuration operates independently of "segment.ms" and "segment.bytes" configurations. Moreover, it triggers the rolling of new segment if the retention.bytes is configured to zero.\\\'\'  configs.30:\'kafka2.DescribeConfigsResourceResult32a  name:delete.retention.ms  value:86400000  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.cleaner.delete.retention.ms  value:86400000  source:5"  config_type:5  documentation:\\\'The amount of time to retain delete tombstone markers for <a href="#compaction">log compacted</a> topics. This setting also gives a bound on the time in which a consumer must complete a read if they begin from offset 0 to ensure that they get a valid snapshot of the final stage (otherwise delete tombstones may be collected before they complete their scan).\\\'\'  configs.31:\'kafka2.DescribeConfigsResourceResult32a  name:message.timestamp.after.max.ms  value:9223372036854775807  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.message.timestamp.after.max.ms  value:9223372036854775807  source:5"  config_type:5  documentation:"This configuration sets the allowable timestamp difference between the message timestamp and the broker\\\'s timestamp. The message timestamp can be later than or equal to the broker\\\'s timestamp, with the maximum allowable difference determined by the value set in this configuration. If message.timestamp.type=CreateTime, the message will be rejected if the difference in timestamps exceeds this specified threshold. This configuration is ignored if message.timestamp.type=LogAppendTime."\'  configs.32:\'kafka2.DescribeConfigsResourceResult32a  name:message.timestamp.before.max.ms  value:9223372036854775807  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.message.timestamp.before.max.ms  value:9223372036854775807  source:5"  config_type:5  documentation:"This configuration sets the allowable timestamp difference between the broker\\\'s timestamp and the message timestamp. The message timestamp can be earlier than or equal to the broker\\\'s timestamp, with the maximum allowable difference determined by the value set in this configuration. If message.timestamp.type=CreateTime, the message will be rejected if the difference in timestamps exceeds this specified threshold. This configuration is ignored if message.timestamp.type=LogAppendTime."\'  configs.33:\'kafka2.DescribeConfigsResourceResult32a  name:segment.ms  value:604800000  read_only:N  config_source:5  is_sensitive:N  config_type:5  documentation:"This configuration controls the period of time after which Kafka will force the log to roll even if the segment file isn\\\'t full to ensure that retention can delete or compact old data."\'  configs.34:\'kafka2.DescribeConfigsResourceResult32a  name:message.timestamp.difference.max.ms  value:9223372036854775807  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.message.timestamp.difference.max.ms  value:9223372036854775807  source:5"  config_type:5  documentation:"[DEPRECATED] The maximum difference allowed between the timestamp when a broker receives a message and the timestamp specified in the message. If message.timestamp.type=CreateTime, a message will be rejected if the difference in timestamp exceeds this threshold. This configuration is ignored if message.timestamp.type=LogAppendTime."\'  configs.35:\'kafka2.DescribeConfigsResourceResult32a  name:segment.index.bytes  value:10485760  read_only:N  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:log.index.size.max.bytes  value:10485760  source:5"  config_type:3  documentation:"This configuration controls the size of the index that maps offsets to file positions. We preallocate this index file and shrink it only after log rolls. You generally should not need to change this setting."\''
